`,b=e=>{let{children:a}=e;return(0,m.jsx)(k.A,{children:(0,m.jsx)(g,{children:(0,m.jsx)(j,{children:a})})})},h=JSON.parse('[{"theme":"Epilacja laserowa","question":"Jak dzia\u0142a epilacja laserowa?","answer":"Epilacja laserowa polega na emitowaniu wi\u0105zki \u015bwiat\u0142a, kt\xf3ra jest poch\u0142aniana przez melanin\u0119 (barwnik) w mieszkach w\u0142osowych. Energia lasera niszczy mieszek w\u0142osowy, co hamuje wzrost w\u0142osa. Zabieg dzia\u0142a najlepiej na ciemne w\u0142osy na jasnej sk\xf3rze, ale nowoczesne lasery mog\u0105 by\u0107 stosowane na r\xf3\u017cnych typach sk\xf3ry i w\u0142os\xf3w. W naszej klinice posiadamy laser diodowo-aleksandrytowy. Wi\u0105zka \u015bwiat\u0142a emitowanego przez diod\u0119 dzia\u0142a na melanin\u0119 podczas gdy chromoforem dla wi\u0105zki aleksandrytowej s\u0105 naczynia krwiono\u015bne. Dzi\u0119ki takiej technologii mamy wi\u0119ksz\u0105 skuteczno\u015b\u0107 w epilacji w\u0142os\xf3w jasnych b\u0105d\u017a siwych."},{"theme":"Epilacja laserowa","question":"Czy epilacja laserowa jest bolesna?","answer":"Odczucia podczas zabiegu zale\u017c\u0105 od indywidualnej wra\u017cliwo\u015bci na b\xf3l oraz od obszaru cia\u0142a, na kt\xf3rym zabieg jest wykonywany. W naszej klinice niekorzy opisuj\u0105 uczucie jako lekkie pieczenie lub uk\u0142ucie. Wykorzystywany przez nas medyczny laser Motus AX to urz\u0105dzenie wyposa\u017cone w system ch\u0142odzenia, kt\xf3ry minimalizuje dyskomfort."},{"theme":"Epilacja laserowa","question":"Ile sesji potrzeba, aby uzyska\u0107 pe\u0142ne efekty?","answer":"Zazwyczaj potrzeba od 6 do 8 sesji, aby osi\u0105gn\u0105\u0107 trwa\u0142e rezultaty. W\u0142osy rosn\u0105 w r\xf3\u017cnych fazach, a laser skutecznie dzia\u0142a tylko na w\u0142osy w fazie wzrostu (anagen). Dlatego konieczne jest kilka zabieg\xf3w, aby usun\u0105\u0107 wszystkie w\u0142osy. "},{"theme":"Epilacja laserowa","question":"Czy epilacja laserowa jest bezpieczna?","answer":"Tak, epilacja laserowa jest bezpieczna, o ile wykonywana jest przez przeszkolonego specjalist\u0119 na odpowiednio dobranym medycznym i certyfikowanym urz\u0105dzeniu. Jak ka\u017cdy zabieg, niesie pewne ryzyko, takie jak podra\u017cnienia sk\xf3ry, zaczerwienienia czy przebarwienia, kt\xf3re zazwyczaj s\u0105 tymczasowe. "},{"theme":"Epilacja laserowa","question":"Czy epilacja laserowa jest trwa\u0142a?","answer":"Epilacja laserowa daje d\u0142ugotrwa\u0142e efekty, a u wielu os\xf3b w\u0142osy nie odrastaj\u0105 przez d\u0142ugie miesi\u0105ce lub lata. Mo\u017ce si\u0119 jednak zdarzy\u0107, \u017ce pewna liczba w\u0142os\xf3w odro\u015bnie, ale b\u0119d\u0105 one zwykle cie\u0144sze i ja\u015bniejsze. Zaleca si\u0119 sesje przypominaj\u0105c\u0105 raz w roku. "},{"theme":"Epilacja laserowa","question":"Kto mo\u017ce podda\u0107 si\u0119 epilacji laserowej?","answer":"Epilacja laserowa jest odpowiednia dla wi\u0119kszo\u015bci os\xf3b, ale najlepsze efekty uzyskuje si\u0119 u os\xf3b z ciemnymi w\u0142osami i jasn\u0105 sk\xf3r\u0105. Nie zaleca si\u0119 zabieg\xf3w u kobiet w ci\u0105\u017cy. "},{"theme":"Epilacja laserowa","question":"Czy mog\u0119 podda\u0107 si\u0119 epilacji laserowej latem?","answer":"Jak najbardziej! Medyczne urz\u0105dzenia do epilacji to bezpieczne rozwi\u0105zania. Sk\xf3ra nie powinna mie\u0107 du\u017cego kontaktu ze s\u0142o\u0144cem na 10-14 dni przed zabiegiem, a po zabiegu trzeba unika\u0107 ekspozycji na s\u0142o\u0144ce przez co najmniej dwa tygodnie. Konieczne jest tak\u017ce stosowanie krem\xf3w z wysokim filtrem przeciws\u0142onecznym szczeg\xf3lnie gdy epilujemy obszary tj. W\u0105sik, broda czy d\u0142onie."},{"theme":"Epilacja laserowa","question":"Jak przygotowa\u0107 si\u0119 do zabiegu?","answer":"Na minimum miesi\u0105c przed zabiegiem: \ud83d\udc4dnie wyrywaj w\u0142osk\xf3w za pomoc\u0105 p\u0119sety, wosku i innych metod usuwaj\u0105cych w\u0142os wraz z cebulk\u0105, \ud83d\udc4dnie stosuj krem\xf3w i ma\u015bci z witaminami A i C. Na tydzie\u0144 przed zabiegiem: \ud83d\udc4dwykonaj ostatni peeling lub inny zabieg z\u0142uszczaj\u0105cy, \ud83d\udc4dzadbaj o odpowiednie nawil\u017cenie sk\xf3ry \u2013 pij min. 2 litry wody mineralnej. Zbyt s\u0142abo nawil\u017cona sk\xf3ra mo\u017ce reagowa\u0107  na zabieg du\u017co wi\u0119kszym podra\u017cnieniem. Na 24 h przed zabiegiem: \ud83d\udc4ddok\u0142adnie og\xf3l w\u0142osy z miejsca, kt\xf3re b\u0119dzie poddane dzia\u0142aniu lasera, \ud83d\udc4dunikaj stosowania krem\xf3w samoopalaj\u0105cych oraz ekspozycji na s\u0142o\u0144ce. "},{"theme":"Epilacja laserowa","question":"Czy po zabiegu epilacji laserowej mog\u0119 wr\xf3ci\u0107 do codziennych aktywno\u015bci?","answer":"Tak, mo\u017cna wr\xf3ci\u0107 do codziennych aktywno\u015bci bezpo\u015brednio po zabiegu, jednak nale\u017cy unika\u0107 intensywnych \u0107wicze\u0144, gor\u0105cych k\u0105pieli, sauny i basenu przez kilka dni, aby unikn\u0105\u0107 podra\u017cnie\u0144 sk\xf3ry. "},{"theme":"Epilacja laserowa","question":"Jakie s\u0105 mo\u017cliwe skutki uboczne epilacji laserowej?","answer":"Najcz\u0119stsze skutki uboczne to zaczerwienienie, obrz\u0119k i uczucie pieczenia sk\xf3ry, kt\xf3re ust\u0119puj\u0105 po kilku godzinach do kilku dni. Przy zastosowaniu nieodpowiedniego sprz\u0119tu mog\u0105 wyst\u0105pi\u0107 przebarwienia sk\xf3ry, p\u0119cherze czy blizny. Epilacja laserowa to skuteczny i coraz bardziej popularny spos\xf3b na trwa\u0142e usuni\u0119cie niechcianego ow\u0142osienia, jednak warto dok\u0142adnie zapozna\u0107 si\u0119 z przeciwwskazaniami i zaleceniami przed rozpocz\u0119ciem serii zabieg\xf3w."},{"theme":"Endermologia LPG","question":"Na czym polega zabieg endermologii Alliance LPG?","answer":"Endermologia Alliance LPG to zabieg wykorzystuj\u0105cy nowoczesn\u0105 technologi\u0119 masa\u017cu podci\u015bnieniowego, kt\xf3ry stymuluje sk\xf3r\u0119 i tkanki podsk\xf3rne. Poprzez delikatne zasysanie i masowanie, pobudza naturalne procesy regeneracyjne, poprawia kr\u0105\u017cenie, wspomaga odprowadzanie toksyn oraz redukuje cellulit."},{"theme":"Endermologia LPG","question":"Jakie efekty mo\u017cna osi\u0105gn\u0105\u0107 dzi\u0119ki endermologii Alliance LPG?","answer":"Zabieg mo\u017ce przynie\u015b\u0107 wiele korzy\u015bci, w tym redukcj\u0119 cellulitu, wyszczuplenie wybranych partii cia\u0142a, uj\u0119drnienie sk\xf3ry, a tak\u017ce popraw\u0119 jej elastyczno\u015bci i wyg\u0142adzenie. Dodatkowo mo\u017ce wspiera\u0107 procesy detoksykacji organizmu i poprawi\u0107 og\xf3lne samopoczucie."},{"theme":"Endermologia LPG","question":"Ile zabieg\xf3w endermologii Alliance potrzebuj\u0119, aby zobaczy\u0107 efekty?","answer":"Pierwsze efekty mog\u0105 by\u0107 widoczne ju\u017c po kilku zabiegach, jednak zazwyczaj zaleca si\u0119 seri\u0119 10-15 zabieg\xf3w, wykonywanych 1-2 razy w tygodniu, aby uzyska\u0107 optymalne rezultaty. Liczba zabieg\xf3w zale\u017cy od indywidualnych potrzeb pacjenta oraz celu, jaki chce osi\u0105gn\u0105\u0107. Jedno jest pewne endermologia wci\u0105ga \ud83d\ude09."},{"theme":"Endermologia LPG","question":"Czy zabieg jest bolesny?","answer":"Endermologia Alliance LPG jest zazwyczaj bezbolesna, a wielu pacjent\xf3w opisuje j\u0105 jako przyjemny masa\u017c. Intensywno\u015b\u0107 zabiegu mo\u017cna dostosowa\u0107 do wra\u017cliwo\u015bci sk\xf3ry pacjenta. W przypadku bardziej delikatnych obszar\xf3w cia\u0142a mo\u017ce wyst\u0105pi\u0107 uczucie lekkiego dyskomfortu, ale nie powinno to by\u0107 bolesne. "},{"theme":"Endermologia LPG","question":"Czy endermologia Alliance LPG jest bezpieczna?","answer":"Tak, zabieg jest bezpieczny, nieinwazyjny i bezpieczny dla wi\u0119kszo\u015bci pacjent\xf3w. Stosowana technologia zosta\u0142a zatwierdzona przez instytucje medyczne na ca\u0142ym \u015bwiecie. Zabieg mo\u017ce by\u0107 wykonywany u os\xf3b o r\xf3\u017cnych typach sk\xf3ry, bez ryzyka jej uszkodzenia. W klinice z powodzeniem wykonujemy zabiegi endermologii dla kobiet w ci\u0105\u017cy czy u os\xf3b po interwencjach chirurgicznych (np. Plastyka piersi czy liposukcja brzucha)."},{"theme":"Endermologia LPG","question":"Czy endermologia Alliance LPG pomaga w odchudzaniu?","answer":"Endermologia Alliance LPG wspomaga proces odchudzania poprzez redukcj\u0119 cellulitu i modelowanie sylwetki, ale nie jest to metoda typowo odchudzaj\u0105ca. Najlepsze efekty uzyskuje si\u0119, \u0142\u0105cz\u0105c zabiegi z odpowiedni\u0105 diet\u0105 i aktywno\u015bci\u0105 fizyczn\u0105. "},{"theme":"Endermologia LPG","question":"Czy s\u0105 przeciwwskazania do zabiegu endermologii Alliance?","answer":"Tak, istniej\u0105 pewne przeciwwskazania do zabiegu. Nale\u017c\u0105 do nich m.in. aktywna choroba nowotworowa, infekcje sk\xf3rne, stany zapalne, sk\u0142onno\u015b\u0107 do krwawie\u0144 oraz niewydolno\u015b\u0107 nerek. Przed przyst\u0105pieniem do serii zabieg\xf3w nale\u017cy skonsultowa\u0107 si\u0119 ze specjalist\u0105, kt\xf3ry przeprowadzi kwalifikacj\u0119."},{"theme":"Endermologia LPG","question":"Jak przygotowa\u0107 si\u0119 do zabiegu?","answer":"Nie s\u0105 wymagane szczeg\xf3lne przygotowania przed zabiegiem. Zaleca si\u0119 jednak picie odpowiedniej ilo\u015bci wody przed i po zabiegu, aby wspom\xf3c procesy detoksykacyjne. Na zabieg warto przyj\u015b\u0107 w wygodnym ubraniu, a na miejscu zakwalifikowana osoba otrzyma specjalny kostium, kt\xf3ry umo\u017cliwia prawid\u0142owe wykonanie procedury."},{"theme":"Endermologia LPG","question":"Czy po zabiegu mog\u0119 wr\xf3ci\u0107 do normalnych aktywno\u015bci?","answer":"Tak, endermologia Alliance LPG nie wymaga okresu rekonwalescencji, a podopieczny mo\u017ce natychmiast wr\xf3ci\u0107 do codziennych aktywno\u015bci. Po zabiegu zaleca si\u0119 picie du\u017cej ilo\u015bci wody oraz utrzymanie zdrowej diety, aby wspom\xf3c procesy regeneracyjne sk\xf3ry i organizmu."},{"theme":"Endermologia LPG","question":"Czy zabieg endermologii Alliance LPG mo\u017cna \u0142\u0105czy\u0107 z innymi zabiegami?","answer":"Tak, endermologi\u0119 mo\u017cna \u0142\u0105czy\u0107 z innymi zabiegami wyszczuplaj\u0105cymi i uj\u0119drniaj\u0105cymi, takimi jak fala uderzeniowa, kriolipoliza czy radiofrekwencja. Przed zastosowaniem terapii \u0142\u0105czonej zaleca si\u0119 jednak konsultacj\u0119 ze specjalist\u0105."},{"theme":"Oczyszczenie wodorowe","question":"Na czym polega oczyszczanie wodorowe HEBE?","answer":"Oczyszczanie wodorowe HEBE to zabieg, kt\xf3ry polega na wprowadzeniu aktywnego wodoru w g\u0142\u0105b sk\xf3ry. Wod\xf3r dzia\u0142a jako silny antyoksydant, neutralizuj\u0105c wolne rodniki, kt\xf3re odpowiadaj\u0105 za starzenie si\u0119 sk\xf3ry. Zabieg oczyszcza, nawil\u017ca, od\u017cywia i wspomaga regeneracj\u0119 sk\xf3ry."},{"theme":"Oczyszczenie wodorowe","question":"Jakie efekty mo\u017cna uzyska\u0107 po zabiegu?","answer":"Zabieg oczyszczania wodorowego HEBE przynosi efekty w postaci g\u0142\u0119bokiego oczyszczenia sk\xf3ry, usuni\u0119cia martwych kom\xf3rek, zmniejszenia stan\xf3w zapalnych i zask\xf3rnik\xf3w, a tak\u017ce nawil\u017cenia i wyg\u0142adzenia sk\xf3ry. Sk\xf3ra staje si\u0119 bardziej promienna, elastyczna i od\u015bwie\u017cona. Dodatkowo wod\xf3r chroni przed stresem oksydacyjnym, kt\xf3ry przyspiesza procesy starzenia."},{"theme":"Oczyszczenie wodorowe","question":"Czy zabieg oczyszczania wodorowego jest bezpieczny?","answer":"Tak, oczyszczanie wodorowe jest bezpieczne i nieinwazyjne. Mo\u017ce by\u0107 stosowane u os\xf3b o r\xf3\u017cnych typach sk\xf3ry, w tym u os\xf3b z cer\u0105 wra\u017cliw\u0105 lub sk\u0142onn\u0105 do podra\u017cnie\u0144. Zabieg nie wymaga \u017cadnej rekonwalescencji i nie powoduje skutk\xf3w ubocznych. W klinice wykonujemy zabieg dla kobiet w ci\u0105\u017cy czy w po\u0142ogu."},{"theme":"Oczyszczenie wodorowe","question":"Czy zabieg oczyszczania wodorowego jest bolesny?","answer":"Zabieg oczyszczania wodorowego jest bezbolesny i przyjemny. Wi\u0119kszo\u015b\u0107 pacjent\xf3w opisuje go jako relaksuj\u0105cy i od\u015bwie\u017caj\u0105cy. Mo\u017ce wyst\u0105pi\u0107 jedynie lekkie uczucie ch\u0142odzenia podczas aplikacji wodoru na sk\xf3r\u0119."},{"theme":"Oczyszczenie wodorowe","question":"Dla kogo przeznaczony jest zabieg oczyszczania wodorowego?","answer":"Zabieg jest odpowiedni dla os\xf3b w ka\u017cdym wieku i z r\xf3\u017cnymi typami cery, zw\u0142aszcza dla os\xf3b z cer\u0105 zm\u0119czon\u0105, zanieczyszczon\u0105, z problemami tr\u0105dzikowymi lub oznakami starzenia. Szczeg\xf3lnie polecany jest dla os\xf3b, kt\xf3re poszukuj\u0105 g\u0142\u0119bokiego oczyszczenia i od\u015bwie\u017cenia sk\xf3ry, a jednocze\u015bnie chc\u0105 chroni\u0107 j\u0105 przed szkodliwym dzia\u0142aniem wolnych rodnik\xf3w."},{"theme":"Oczyszczenie wodorowe","question":"Jakie s\u0105 przeciwwskazania do zabiegu","answer":"Przeciwwskazania do zabiegu oczyszczania wodorowego s\u0105 minimalne. Zabieg nie jest zalecany u os\xf3b z aktywnymi infekcjami sk\xf3rnymi, ci\u0119\u017ckim tr\u0105dzikiem, opryszczk\u0105, czy stanami zapalnymi sk\xf3ry. W przypadku ci\u0105\u017cy i chor\xf3b sk\xf3ry warto skonsultowa\u0107 si\u0119 z dermatologiem lub specjalist\u0105 przed przyst\u0105pieniem do zabiegu. "},{"theme":"Oczyszczenie wodorowe","question":"Jak cz\u0119sto mo\u017cna wykonywa\u0107 zabieg oczyszczania wodorowego?","answer":"Zabieg mo\u017cna wykonywa\u0107 regularnie, w zale\u017cno\u015bci od potrzeb sk\xf3ry. Zaleca si\u0119 wykonywanie go co 3-4 tygodnie jako element regularnej piel\u0119gnacji sk\xf3ry. W przypadku bardziej problematycznych typ\xf3w sk\xf3ry, takich jak tr\u0105dzikowa lub zanieczyszczona, seria zabieg\xf3w mo\u017ce by\u0107 wykonywana cz\u0119\u015bciej. "},{"theme":"Oczyszczenie wodorowe","question":"Czy po zabiegu oczyszczania wodorowego mog\u0119 wr\xf3ci\u0107 do codziennych aktywno\u015bci?","answer":"Tak, zabieg nie wymaga okresu rekonwalescencji. Sk\xf3ra po zabiegu jest od razu od\u015bwie\u017cona i promienna, dlatego mo\u017cna natychmiast wr\xf3ci\u0107 do codziennych aktywno\u015bci. Nale\u017cy jednak stosowa\u0107 si\u0119 do zalece\u0144 dotycz\u0105cych piel\u0119gnacji sk\xf3ry po zabiegu, takich jak ochrona przeciws\u0142oneczna. "},{"theme":"Oczyszczenie wodorowe","question":"Czy oczyszczanie wodorowe HEBE mo\u017cna \u0142\u0105czy\u0107 z innymi zabiegami?","answer":"Tak, oczyszczanie wodorowe mo\u017cna \u0142\u0105czy\u0107 z innymi zabiegami, takimi jak mezoterapia, peelingi chemiczne czy zabiegi nawil\u017caj\u0105ce, w celu osi\u0105gni\u0119cia lepszych efekt\xf3w. Zabieg ten doskonale przygotowuje sk\xf3r\u0119 do dalszych procedur piel\u0119gnacyjnych, poprawiaj\u0105c ich skuteczno\u015b\u0107."},{"theme":"Oczyszczenie wodorowe","question":"Jak przygotowa\u0107 si\u0119 do zabiegu oczyszczania wodorowego?","answer":"Przed zabiegiem oczyszczania wodorowego nie s\u0105 wymagane specjalne przygotowania. Zaleca si\u0119 przyj\u015bcie z czyst\u0105 sk\xf3r\u0105, bez makija\u017cu, ale w gabinecie kosmetycznym specjalista dok\u0142adnie oczy\u015bci sk\xf3r\u0119 przed przyst\u0105pieniem do zabiegu. Te pytania i odpowiedzi pomog\u0105 zrozumie\u0107, na czym polega oczyszczanie wodorowe HEBE i jakie korzy\u015bci mo\u017ce przynie\u015b\u0107 dla sk\xf3ry."}]');var x=i(4891);const f=["Endermologia LPG","Oczyszczenie wodorowe","Epilacja laserowa","Wszystkie"],E=()=>{const[e,a]=(0,o.useState)(h);return(0,m.jsxs)(z,{children:[(0,m.jsx)(b,{children:f.map(((e,i)=>(0,m.jsx)(x.vZ,{onClick:()=>(e=>{switch(e){case"Endermologia LPG":a(h.filter((e=>"Endermologia LPG"===e.theme)));break;case"Oczyszczenie wodorowe":a(h.filter((e=>"Oczyszczenie wodorowe"===e.theme)));break;case"Epilacja laserowa":a(h.filter((e=>"Epilacja laserowa"===e.theme)));break;default:a(h)}})(e),children:(0,m.jsx)("p",{children:e})},i)))}),(0,m.jsx)(u,{question:e})]})}},4891:(e,a,i)=>{i.d(a,{eJ:()=>r,mO:()=>z,vZ:()=>c,wn:()=>s});var o=i(1758),n=i(2467);const s=o.A.div`
